import React, { Component } from 'react'

export default class Testeee extends Component {
  constructor() {
    super()

    this.state = {
      username:null,
      password:null,
      login:false,
      token:null,
    }
  }
dokhol(){
  console.warn("form data", this.state)
}
  render() {

    return (
      <div>
        <form onSubmit={this.dokhol}>
          <div>
            <input
              type="text"

              onChange={(event)=>{this.setState({username:event.target.value})}}
            />
          </div>
          <div>
            <input
              type="text"

          onChange={(event)=>{this.setState({password:event.target.value})}}
            />
          </div>

          <button type="submit">Submit</button>
        </form>
      </div>
    )
  }
}
